-- Status table --------------------------------------------------------------

CREATE TABLE status (
    id INT PRIMARY KEY,
    status_name VARCHAR(50) NOT NULL
);



-- Genders table --------------------------------------------------------------

CREATE TABLE genders (
    id INT PRIMARY KEY,
    gender VARCHAR(50) NOT NULL
);



-- Interests table --------------------------------------------------------------

CREATE TABLE interests (
    id SERIAL PRIMARY KEY,
    name VARCHAR(50) UNIQUE NOT NULL
);



-- Users table --------------------------------------------------------------

CREATE TABLE users (
    id SERIAL PRIMARY KEY,
    email VARCHAR(255) UNIQUE NOT NULL,
    username VARCHAR(50) UNIQUE NOT NULL,
    password VARCHAR(255) NOT NULL,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    birth_date DATE NOT NULL,
    gender_id INT REFERENCES genders(id),
    sexual_preferences INT[] DEFAULT '{}',
    biography TEXT,
    status_id INT REFERENCES status(id) DEFAULT 0,
    verification_token VARCHAR(255),
    latitude FLOAT,
    longitude FLOAT,
    city VARCHAR(100),
    geolocation_consent BOOLEAN DEFAULT FALSE,
    created_at TIMESTAMP DEFAULT NOW()
);


-- User Interests table --------------------------------------------------------------

CREATE TABLE user_interests (
    user_id INT REFERENCES users(id) ON DELETE CASCADE,
    interest_id INT REFERENCES interests(id) ON DELETE CASCADE,
    PRIMARY KEY (user_id, interest_id)
);


-- Images table --------------------------------------------------------------

CREATE TABLE images (
    id SERIAL PRIMARY KEY,
    user_id INT REFERENCES users(id) ON DELETE CASCADE,
    url VARCHAR(255) NOT NULL,
    is_profile_picture BOOLEAN DEFAULT FALSE,
    created_at TIMESTAMP DEFAULT NOW()
);


-- INSERT DEBUG USER --------------------------------------------------------------



-- Matches table --------------------------------------------------------------

CREATE TABLE matches (
    id SERIAL PRIMARY KEY,
    user_id_1 INT REFERENCES users(id),
    user_id_2 INT REFERENCES users(id),
    created_at TIMESTAMP DEFAULT NOW(),
    UNIQUE(user_id_1, user_id_2)
);

-- Conversations table --------------------------------------------------------------

CREATE TABLE conversations (
    id SERIAL PRIMARY KEY,
    match_id INT REFERENCES matches(id) ON DELETE CASCADE,
    created_at TIMESTAMP DEFAULT NOW(),
    updated_at TIMESTAMP DEFAULT NOW()
);

-- Messages table --------------------------------------------------------------

CREATE TABLE messages (
    id SERIAL PRIMARY KEY,
    conversation_id INT REFERENCES conversations(id) ON DELETE CASCADE,
    sender_id INT REFERENCES users(id),
    content TEXT NOT NULL,
    is_read BOOLEAN DEFAULT FALSE,
    created_at TIMESTAMP DEFAULT NOW()
);

